  false,\n\t\"url\": null,\n\t\"notes\": \"This data layer (PAC_EXT.txt) is one of
  five point coverages of known sediment samples, inspections, and probes from the
  usSEABED data collection for the U.S. Pacific continental margin integrated using
  the software system dbSEABED. This data layer represents the extracted (EXT) output
  of the dbSEABED mining software and contains data items which were extracted from
  the data resources files and generally represent lab-based analytical data. The
  EXT data are usually considered the most rigorous data available, although some
  data may represent a subsample of the sediment (that is, large shells or stones
  may have been excluded from the analysis). This file contains the same data fields
  as the parsed (PAC_PRS) and calculated (PAC_CLC) data files, and the three files
  may be combined.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
